import React from "react";
import { useHistory } from "react-router-dom";

function Home() {
  const history = useHistory();

  const handleSignOut = () => {
    // You can add any sign-out logic here (e.g., clearing authentication tokens, state, etc.)
    // For this example, we're simply navigating back to the login/signup page.
    
    // Assuming your login/signup page is at the root path ("/")
    history.push("/");
  };

  return (
    <div className="home">
      <h2>Welcome to our website (After login)</h2>
      <button onClick={handleSignOut}>Sign out</button>
    </div>
  );
}

export default Home;
